import React from 'react';
import HeroSection from '../../components/HeroSection/HeroSection';
import FeatureHighlight from '../../components/FeatureHighlight/FeatureHighlight';
import Testimonials from '../../components/Testimonials/Testimonials';
import FooterCTA from '../../components/FooterCTA/FooterCTA';
import backgroundVideo from '../../assets/videos/logovideo.mp4';

import './LandingPage.css'; // Import the CSS file for styling

import SEO from '../../components/SEO/Seo'; // SEO meta tags component

const LandingPage = () => {
  return (
    <>
      <SEO title="TechSaaS Vision - Empowering Your Business" />
      <div className="landing-page">
        <video
          className="background-video"
          autoPlay
          loop
          muted
          playsInline
        >
          <source src={backgroundVideo} type="video/mp4" />
          Your browser does not support the video tag.
        </video>
        <div className="overlay"></div>
        <div className="content">
          <HeroSection
            title="Empower Your Business with TechSaaS Vision"
            subtitle="Innovative, Scalable, and Secure Solutions to Drive Your Success"
            ctaButton={<button>Get Started</button>}
            overlayOpacity={0.5} // Custom opacity value
            buttonBackground="transparent" // Remove button background
          />
          <FeatureHighlight />
          <Testimonials />
          <FooterCTA text="Ready to take your business to the next level?" />
        </div>
      </div>
    </>
  );
};

export default LandingPage;
